import React from "react";

function Watch() {
  return (
    <>
      <div>
        <div className="bg-cyan-300	 h-64 rounded-lg pt-0.5 ">
          <div className="bg-cyan-50 h-24 w-40 rounded-lg ml-2 mt-4"></div>
        </div>
      </div>
    </>
  );
}

export default Watch;
